import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render() {
        return (
            <div id="MainApp">
                <div className="Buttons">
                    <PeopleButton />
                    <PlacesButton />
                    <DatesButton />
                </div>
                <Search />
                <Input />
                <Data />
            </div>
        );
    }
}

export default App;
class PeopleButton extends Component {

}
